import React from 'react';
import { ShoppingCartIcon, MagnifyingGlassIcon } from '@heroicons/react/24/solid';
import NavigationButton from './NavigationButton';
interface Props {

}

const NavigationBar: React.FC<Props> = () => {
	return (
		<header className="shadow-lg shadow-slate-200 h-30 ">
			<div className="flex flex-row justify-between">

				<div className="ml-10">
				</div>

				<div className="text-center flex w-96">
					<NavigationButton
						isPressed = {false}
						text = {"Home"}
					/>	
					<button className="w-1/4 h-30 font-raleway text-stone-300 transition ease-in-out hover:bg-stone-400 hover:text-stone-50 duration-200">Products</button>
					<button className="w-1/4 h-30 font-raleway text-stone-300 transition ease-in-out hover:bg-stone-400 hover:text-stone-50 duration-200">Blog</button>
					<button className="w-1/4 h-30 font-raleway text-stone-300 transition ease-in-out hover:bg-stone-400 hover:text-stone-50 duration-200">About</button>
				</div>

				<div className="mr-10">
					<div className="flex">
						<button className="h-30 p-3 transition ease-in-out hover:bg-stone-400 hover:text-stone-50 duration-200">
							<MagnifyingGlassIcon className="h-6 w-6 mx-3 text-black-500" />
						</button>
						<button className="h-30 p-3 transition ease-in-out hover:bg-stone-400 hover:text-stone-50 duration-200">
							<ShoppingCartIcon className="h-6 w-6 mx-3 text-black-500" />
						</button>
					</div>
				</div>
			</div>
		</header>
	);
}

export default NavigationBar;
